import styled from 'styled-components'
import {
  Container,
  Content,
  Title,
  Subtitle,
  Column,
  Paragraph,
} from '../components/Components'

const Homepage = ({ styles }) => {
  return (
    <Container>
      <Content>
        <Header>
          <Paragraph size={styles.paragraphs.p1}>Années 2021-2024</Paragraph>
        </Header>
        <Column>
          <Title size={styles.titles.t1}>Projet d'études</Title>
          <Subtitle size={styles.subtitles.s1} color={styles.palette.blacks.b2}>
            Baptiste DAUPHOUY
          </Subtitle>
        </Column>
      </Content>
    </Container>
  )
}

const Header = styled.header`
  height: 60px;
  display: block;
  display: flex;
  justify-content: flex-end;
  align-items: center;
`

export default Homepage
